description:
Defender from Manowar from 1983, is an American heavy metal band from Auburn, New York. Formed in 1980, the group is known for its lyrics based on fantasy (particularly sword and sorcery), mythological topics (particularly Norse mythology) and for playing a lot of songs about heavy metal music, along with their &quot;loud and bombastic&quot; sound.

